function Contact () {
    return(
        <>
            <div id="contact" class="contact">
                <h1>Contact Me</h1>
                <div class="socials">
                    <h2><a href="https://www.linkedin.com/in/manar-elbeshbishy">LinkedIn</a></h2>
                    <h2><a href="https://github.com/m-el-code">Github</a></h2>
                    <h2><a href="mailto:manar.04e@gmail.com">Email</a></h2>
                    <h2><a href="https://drive.google.com/file/d/1Bp__EX0BnmyJjAs3TAHg4_CtHY_A5qJ9/view?usp=sharing">Resume</a></h2>
                </div>
            </div>
        </>
    );
}

export default Contact;
